// src/pages/ProjectDetails.js
import React, { useState, useEffect } from 'react';
import { useParams, Link, useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useProject } from '../hooks/useProject';

const ProjectDetails = () => {
  const { projectId } = useParams();
  const navigate = useNavigate();
  const { project, images, loading, error } = useProject(projectId);
  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  if (loading) {
    return <LoadingIndicator>Loading project details...</LoadingIndicator>;
  }

  if (error || !project) {
    return (
      <ErrorContainer>
        <ErrorMessage>
          Project not found or couldn't be loaded.
        </ErrorMessage>
        <BackButton onClick={() => navigate(-1)}>
          Go Back
        </BackButton>
      </ErrorContainer>
    );
  }

  const nextImage = () => {
    setCurrentImageIndex((prev) => 
      prev === images.length - 1 ? 0 : prev + 1
    );
  };

  const prevImage = () => {
    setCurrentImageIndex((prev) => 
      prev === 0 ? images.length - 1 : prev - 1
    );
  };

  return (
    <ProjectDetailsContainer
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <BackLink to={`/projects/${project.info.type}`}>
        ← Back to {project.info.type} projects
      </BackLink>
      
      <ProjectHeader>
        <ProjectTitle>{projectId}</ProjectTitle>
        <ProjectType>{project.info.type}</ProjectType>
      </ProjectHeader>
      
      {images.length > 0 && (
        <ImagesSection>
          <ImageContainer>
            <CurrentImage 
              src={`/projects/${projectId}/images/${images[currentImageIndex]}`} 
              alt={`${projectId} - ${currentImageIndex + 1}`} 
            />
            
            {images.length > 1 && (
              <>
                <NavigationButton left onClick={prevImage}>
                  &lt;
                </NavigationButton>
                <NavigationButton right onClick={nextImage}>
                  &gt;
                </NavigationButton>
                
                <ImageCounter>
                  {currentImageIndex + 1} / {images.length}
                </ImageCounter>
              </>
            )}
          </ImageContainer>
          
          {images.length > 1 && (
            <ThumbnailsContainer>
              {images.map((image, index) => (
                <Thumbnail 
                  key={index}
                  src={`/projects/${projectId}/images/${image}`}
                  alt={`${projectId} thumbnail ${index + 1}`}
                  active={index === currentImageIndex}
                  onClick={() => setCurrentImageIndex(index)}
                />
              ))}
            </ThumbnailsContainer>
          )}
        </ImagesSection>
      )}
      
      <DetailsSection>
        <Description>{project.info.description}</Description>
        
        {project.info.technologies && (
          <TechnologiesSection>
            <SectionTitle>Technologies</SectionTitle>
            <TechnologiesList>
              {project.info.technologies.map((tech, index) => (
                <TechnologyTag key={index}>{tech}</TechnologyTag>
              ))}
            </TechnologiesList>
          </TechnologiesSection>
        )}
        
        {project.info.links && project.info.links.length > 0 && (
          <LinksSection>
            <SectionTitle>Links</SectionTitle>
            <LinksList>
              {project.info.links.map((link, index) => (
                <LinkItem key={index}>
                  <ExternalLink 
                    href={link.url} 
                    target="_blank" 
                    rel="noopener noreferrer"
                  >
                    {link.title}
                  </ExternalLink>
                </LinkItem>
              ))}
            </LinksList>
          </LinksSection>
        )}
      </DetailsSection>
    </ProjectDetailsContainer>
  );
};

// Styled Components
const ProjectDetailsContainer = styled(motion.div)`
  padding: 2rem;
  background-color: #0a0e17;
  min-height: 100vh;
  color: white;
  max-width: 1200px;
  margin: 0 auto;
`;

const LoadingIndicator = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 300px;
  color: white;
  font-size: 1.2rem;
`;

const ErrorContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 50vh;
  color: white;
`;

const ErrorMessage = styled.p`
  font-size: 1.2rem;
  margin-bottom: 2rem;
`;

const BackButton = styled.button`
  background-color: #c45b5b;
  color: white;
  border: none;
  padding: 0.5rem 1.5rem;
  border-radius: 4px;
  cursor: pointer;
  font-size: 1rem;
`;

const BackLink = styled(Link)`
  display: inline-block;
  margin-bottom: 2rem;
  color: white;
  text-decoration: none;
  
  &:hover {
    text-decoration: underline;
  }
`;

const ProjectHeader = styled.div`
  margin-bottom: 2rem;
`;

const ProjectTitle = styled.h1`
  font-size: 3rem;
  margin-bottom: 0.5rem;
`;

const ProjectType = styled.span`
  display: inline-block;
  background-color: #c45b5b;
  padding: 0.25rem 1rem;
  border-radius: 20px;
  font-size: 1rem;
`;

const ImagesSection = styled.section`
  margin-bottom: 3rem;
`;

const ImageContainer = styled.div`
  position: relative;
  width: 100%;
  border-radius: 8px;
  overflow: hidden;
  background-color: rgba(255, 255, 255, 0.05);
`;

const CurrentImage = styled.img`
  width: 100%;
  max-height: 600px;
  object-fit: contain;
  display: block;
`;

const NavigationButton = styled.button`
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  background-color: rgba(0, 0, 0, 0.5);
  color: white;
  border: none;
  width: 40px;
  height: 40px;
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 1.5rem;
  cursor: pointer;
  transition: background-color 0.3s ease;
  
  ${({ left }) => left && `
    left: 10px;
  `}
  
  ${({ right }) => right && `
    right: 10px;
  `}
  
  &:hover {
    background-color: rgba(0, 0, 0, 0.8);
  }
`;

const ImageCounter = styled.div`
  position: absolute;
  bottom: 10px;
  right: 10px;
  background-color: rgba(0, 0, 0, 0.5);
  color: white;
  padding: 0.25rem 0.75rem;
  border-radius: 20px;
  font-size: 0.8rem;
`;

const ThumbnailsContainer = styled.div`
  display: flex;
  gap: 0.5rem;
  margin-top: 1rem;
  overflow-x: auto;
  padding-bottom: 0.5rem;
  
  /* Custom scrollbar */
  &::-webkit-scrollbar {
    height: 6px;
  }
  
  &::-webkit-scrollbar-track {
    background: rgba(255, 255, 255, 0.1);
    border-radius: 3px;
  }
  
  &::-webkit-scrollbar-thumb {
    background-color: rgba(255, 255, 255, 0.3);
    border-radius: 3px;
  }
`;

const Thumbnail = styled.img`
  width: 80px;
  height: 60px;
  object-fit: cover;
  border-radius: 4px;
  cursor: pointer;
  transition: transform 0.2s ease;
  border: 2px solid ${({ active }) => active ? '#c45b5b' : 'transparent'};
  
  &:hover {
    transform: scale(1.05);
  }
`;

const DetailsSection = styled.section`
  padding: 2rem;
  background-color: rgba(255, 255, 255, 0.05);
  border-radius: 8px;
`;

const Description = styled.p`
  font-size: 1.1rem;
  line-height: 1.6;
  margin-bottom: 2rem;
`;

const SectionTitle = styled.h3`
  font-size: 1.5rem;
  margin-bottom: 1rem;
`;

const TechnologiesSection = styled.div`
  margin-bottom: 2rem;
`;

const TechnologiesList = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 0.5rem;
`;

const TechnologyTag = styled.span`
  background-color: rgba(255, 255, 255, 0.1);
  padding: 0.25rem 0.75rem;
  border-radius: 20px;
  font-size: 0.9rem;
`;

const LinksSection = styled.div`
  margin-top: 2rem;
`;

const LinksList = styled.ul`
  list-style: none;
  padding: 0;
`;

const LinkItem = styled.li`
  margin-bottom: 0.5rem;
`;

const ExternalLink = styled.a`
  color: #c45b5b;
  text-decoration: none;
  display: inline-flex;
  align-items: center;
  
  &:hover {
    text-decoration: underline;
  }
  
  &::after {
    content: '↗';
    margin-left: 0.25rem;
  }
`;

export default ProjectDetails;
